import React,{Component} from 'react';
import {Link} from "react-router-dom";
import {Menu, Divider} from "antd"
class Index extends Component{
    render(){
        return(
            <div className="wrap">
                <Menu>
                <Menu.Item>菜单项</Menu.Item>
                </Menu>
            </div>
        )
    }
}
export default Index;
